import firebase from 'firebase';

const firebaseConfig = {
 apiKey: 'xxxxxx',
 authDomain: 'xxxxxx.firebaseapp.com',
 databaseURL: 'https://xxxxxx.firebaseio.com',
 projectId: 'xxxxxx',
 storageBucket: '',
 messagingSenderId: 'xxxxxx',
};
const fire=firebase.initializeApp(firebaseConfig);
export default fire;
